function Quote() {

  const options = {
  method: 'GET',
  url: 'https://healthruwords.p.rapidapi.com/v1/quotes/',
  params: {t: 'Wisdom', maxR: '1', size: 'medium', id: '731'},
  headers: {
    'X-RapidAPI-Key': 'f1ce796342mshfa107cca371850dp16216bjsnd3636125edc3',
    'X-RapidAPI-Host': 'healthruwords.p.rapidapi.com'
  }
};

axios.get(options).then(function (response) {
	console.log(response.data);
}).catch(function (error) {
	console.error(error);
});


  return (
    <div>
    <h2> This is an inspiring quote </h2>
    <p > John Doe </p>
    </div>
  );
};

export default Quote;
